    [],nt"revision_timestamp": "2015-09-26T22:08:06.410748",nt"name": "nodc-standard-product-sea-level-data-toga-and-psmsl-through-august-1994-nodc-accession-0095192",nt"isopen":
    false,nt"url": null,nt"notes": "The data on this CD-ROM are provided in
    two main directories. One directory contains Tropical Ocean-Global Atmosphere (TOGA)
    project sea level data, file formats, and associated documentation. The other main
    directory contains the Permanent Service for Mean Sea Level (PSMSL) data, documentation,
    and a few related data sets.nnThe TOGA sea level data are managed by the TOGA Sea
    Level Center at the University of Hawaii in cooperation with the NODC through the
    Joint Archive for Sea Level. This archive holds hourly, daily, and monthly sea level
    values in standard formats from 289 sea level stations in the Pacific, Atlantic,
    and Indian Oceans as of July 1994. The data are primarily in the tropical ocean
    (30N - 30S).nnThe Permanent Service for Mean Sea Level is based at the Proudman
    Oceanographic Laboratory, Bidston Observatory, United Kingdom, and the PSMSL data
    set contains monthly and annual mean values of sea level from approximately 1500
    tide gauge stations around the world as of August 1994. Other related data sets
    are also included such as the IAPSO (International Association for the Physical
    Sciences of the Ocean) Tidal constants data set and the Revised Local Reference
    annual mean values.nnCopies of these discs are currently available via the NODC
    Online Store atnhttp://ols.nndc.noaa.gov/plolstore/plsql/olstore.prodspecific?prodnum=W00016-CDR-A0001.nnAdditional
    details about this NODC standard CD-ROM product are available online atnhttp://www.nodc.noaa.gov/General/CDR-detdesc/sealevel_cd.html",nt"license_title":
